using AventStack.ExtentReports.Model;using NUnit.Framework;namespace AventStack.ExtentReports.Tests{    public class TestInitTests    {        [SetUp]        public void Setup()        {            _test = new Test(Name);        }        [Test]        public void StartAndEndTimesNonNullAtInit()        {            Assert.NotNull(_test.StartTime);            Assert.NotNull(_test.EndTime);        }        [Test]        public void StartIsPassOnInit()        {            Assert.AreEqual(Status.Pass, _test.Status);        }        [Test]        public void LevelIs0OnInit()        {            Assert.AreEqual(0, _test.Level);        }        [Test]        public void TestIsLeafOnInit()        {            Assert.True(_test.Leaf);        }        [Test]        public void ChildrenEmptyOnInit()        {            Assert.True(_test.Children.Count == 0);        }        [Test]        public void LogsEmptyOnInit()        {            Assert.True(_test.Children.Count == 0);        }        [Test]        public void AuthorsEmptyOnInit()        {            Assert.True(_test.Author.Count == 0);        }        [Test]        public void DevicesEmptyOnInit()        {            Assert.True(_test.Device.Count == 0);        }        [Test]        public void TagEmptyOnInit()        {            Assert.True(_test.Category.Count == 0);        }        [Test]        public void DescriptionNullOnInit()        {            Assert.Null(_test.Description);        }        [Test]        public void ParentNullOnInit()        {            Assert.Null(_test.Parent);        }        private const string Name = "Test";        private Test _test;    }}